import React from 'react';
import Header from '../Header'; // مسیر Header را بررسی کنید
import './Gallery.css'; // مسیر فایل CSS را بررسی کنید

function Gallery() {
    return (
        <>
            <Header />
            <div className="gallery-container">
                <h1>عکاسخانه</h1>
                <p>به صفحه گالری خوش آمدید.</p>
                {/* اینجا می‌توانید محتوای گالری را اضافه کنید */}
            </div>
        </>
    );
}

export default Gallery;
